LuaFunction.Formula:
function RC_distToObject(placedObject) 
    return math.sqrt(math.pow(placedObject.geoCoord.X-geoCoord.X, 2) + math.pow(placedObject.geoCoord.Y-geoCoord.Y, 2) + math.pow(placedObject.geoCoord.Z-geoCoord.Z, 2))
end

function NOBN_stageIntersectionFromIds(guidA, guidB)
	ap = NOBN_getStageFromId(guidA)
	bp = NOBN_getStageFromId(guidB)
	return NOBN_stageIntersection(ap,bp)
end

function NOBN_railSeparation()
    return 1.5
end

function NOBN_kmHel()
	return math.floor(math.floor((ReferenceMileage/500)+.5)/2)
end

function NOBN_kmHalv()
	return (math.floor((ReferenceMileage/500)+0.5)%2)*5
end

function NOBN_etikettLinje1()
	return "Km."..NOBN_km(referenceMileage,3)
end

function NOBN_etikettLinje3()
	return "(Ref. "..referenceAlignment.code..")"
end

function NOBN_romningsSkiltTekstVenstre(step,offset)
	return (Variant:match("venstre") or Variant:match("begge")) and NOBN_romningsSkiltTekstVH(step,offset)["Left"] or "-"
end

function NOBN_romningsSkiltTekstHoyre(step,offset)
	return (Variant:match("høyre") or Variant:match("begge")) and NOBN_romningsSkiltTekstVH(step,offset)["Right"] or "-"
end

function NOBN_mcEpsilon()
	return 1.000 -- get system variable here
end

